import{_ as e,Y as t,Z as s,a4 as l}from"./framework-17eb0294.js";const i={},r=l('<h1 id="vuepress-上传笔记注意事项" tabindex="-1"><a class="header-anchor" href="#vuepress-上传笔记注意事项" aria-hidden="true">#</a> VuePress 上传笔记注意事项</h1><p>笔记上传时，展示文章标题的问题：</p><p>文章标题与文件名没有关系，与文章内的<strong>title属性</strong>和第一行的<strong>一号标题</strong>有关系。</p><ol><li>如果只设定了title属性，标题就会是title属性所设置的值。</li><li>如果只设定了一号标题，乜有设置title属性，标题就会是一号标题的内容</li><li>如果两个都设定了，会显示title属性的内容，一号标题的内容会被忽略，且在文章内会被隐藏。</li></ol><p>Markdown文档内附有图片时，应注意：</p><ol><li>路径中可以出现中文，但图片名称中不能存在空格</li><li>图片的后缀名要和文档中保持一致，否则会无法访问到图片，并且图片后缀名要小写，否则编译时会出现问题。</li></ol>',6),o=[r];function _(a,n){return t(),s("div",null,o)}const d=e(i,[["render",_],["__file","VuePress上传笔记注意事项.html.vue"]]);export{d as default};
